  `alipay_account_card` varchar(50) DEFAULT NULL COMMENT '支付宝收款账号',
  `license_type` int(1) DEFAULT '1' COMMENT '营业类型1.线上（互联网）2.线下（实体店铺）3.线上+线下',
  `contacts_name` varchar(50) DEFAULT NULL COMMENT '联系人姓名',
  `contacts_phone` varchar(20) DEFAULT NULL COMMENT '联系人电话',
  `contacts_mail` varchar(50) DEFAULT NULL COMMENT '联系人邮件',
  `company_status` int(1) DEFAULT '1' COMMENT '商户状态,1未审核,2通过(合作中),3未通过,4终止合作',
  `company_pass_reason` varchar(1000) DEFAULT NULL COMMENT '审核未通过原因',
  `is_random` int(1) DEFAULT '1' COMMENT '支付通道是否随机1通道随机2通道按顺序3循环',
  `is_delete` int(1) DEFAULT '2' COMMENT '是否删除,1是,2否',
