  `company_id` bigint(13) DEFAULT NULL COMMENT '商户id,关联payv2_buss_company表',
  `user_id` bigint(13) DEFAULT NULL COMMENT '用户id，关联payv2_pay_user',
  `order_type` int(1) DEFAULT '1' COMMENT '订单类型1.app（线上）2.店铺（线下）',
  `app_id` bigint(13) DEFAULT NULL COMMENT '应用id，关联payv2_buss_company_app或payv2_buss_company_shop表',
  `group_id` bigint(13) DEFAULT NULL COMMENT '订单分组id，关联payv2_pay_order_group表',
  `pay_way_id` bigint(13) DEFAULT NULL COMMENT '支付渠道，关联payv2_pay_way',
  `rate_id` bigint(13) DEFAULT NULL COMMENT '支付通道路由id',
  `rate_type` int(1) DEFAULT '1' COMMENT '支付类型1.app支付2.web3.扫码',
  `pay_way_user_name` varchar(20) DEFAULT NULL COMMENT '收款账号',
  `pay_user_name` varchar(20) DEFAULT NULL COMMENT '支付账号',
  `bank_transaction` varchar(50) DEFAULT NULL COMMENT '银行流水号',
  `pay_money` double(9,2) DEFAULT NULL COMMENT '订单金额',
  `pay_discount_money` double(9,2) NOT NULL DEFAULT '0.00' COMMENT '折扣后的金额,也就是用户最终需要支付的金额',
  `pay_way_money` double(9,2) NOT NULL DEFAULT '0.00' COMMENT '通道费（以分为单位，小于分不收费）商户手续费',
  `buss_way_rate` double(9,2) DEFAULT '0.00' COMMENT '商户费率‰',
  `cost_rate` double(9,2) DEFAULT '0.00' COMMENT '成本费率‰',
  `cost_rate_money` double(9,2) DEFAULT '0.00' COMMENT '成本手续费',
  `discount_id` bigint(13) DEFAULT NULL COMMENT '优惠方案id，关联payv2_app_discount表',
  `discount_money` double(9,2) NOT NULL DEFAULT '0.00' COMMENT '优惠金额',
  `pay_status` int(1) DEFAULT NULL COMMENT '支付状态,1支付成功,2支付失败,3未支付,4超时,5.扣款成功回调失败',
  `liquidation_time` datetime DEFAULT NULL COMMENT '清算时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建订单时间',
  `pay_time` datetime DEFAULT NULL COMMENT '订单支付时间',
  `return_url` varchar(255) DEFAULT NULL COMMENT '返回页面url',
  `notify_url` varchar(255) DEFAULT NULL COMMENT '回调地址url（服务器）',
  `callback_time` datetime DEFAULT NULL COMMENT '订单回调时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_num` (`order_num`),
  UNIQUE KEY `merchant_order_num` (`merchant_order_num`,`app_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10885 DEFAULT CHARSET=utf8 COMMENT='支付集订单';

