  `upstream_amount` double(16,2) DEFAULT '0.00' COMMENT '上游通道订单金额||上游通道退款金额',
  `pay_status` int(1) DEFAULT '1' COMMENT '支付状态,1支付成功,2支付失败,3未支付,4超时,5.扣款成功回调失败||退款状态1.退款成功',
  `upstream_status` int(1) DEFAULT '3' COMMENT '上游通道支付状态1成功2失败3无（理论都是成功）||上游通道退款状态1成功2失败（理论都是成功）',
  `discount_money` double(9,2) DEFAULT '0.00' COMMENT '优惠金额',
  `buss_way_rate_money` double(16,2) DEFAULT '0.00' COMMENT '商户手续费',
  `buss_way_rate` double(9,2) DEFAULT '0.00' COMMENT '商户费率‰',
  `cost_rate` double(9,2) DEFAULT '0.00' COMMENT '成本费‰',
  `cost_rate_money` double(16,2) DEFAULT '0.00' COMMENT '成本手续费',
  `pay_time` datetime DEFAULT NULL COMMENT '交易时间||退款时间',
  `upstream_time` datetime DEFAULT NULL COMMENT '上游通道交易时间||上游通道退款时间',
  `status` int(1) DEFAULT '4' COMMENT '1.正常2.订单异常3.记录可能异常订单4.未对账5出账6隔夜差错7隔夜已处理',
