  `id` bigint(13) NOT NULL AUTO_INCREMENT,
  `way_type` int(1) DEFAULT '1' COMMENT '通道类型,1钱包,2第三方支付',
  `dic_id` bigint(13) DEFAULT NULL COMMENT '接入支付的类型，关联字典表sys_config_dictionary表',
  `way_name` varchar(50) DEFAULT NULL COMMENT '通道名称',
  `way_company_name` varchar(50) DEFAULT NULL COMMENT '所属合作机构或钱包所属银行',
  `merchant_code` varchar(64) DEFAULT NULL COMMENT '合作身份id/商户号',
  `discout_region` bigint(13) DEFAULT NULL COMMENT '优惠支付地区，关联payv2_provinces_city表',
  `is_trust_bank` int(1) DEFAULT '1' COMMENT '是否为资金托管银行1.是2.否',
  `way_icon` varchar(255) DEFAULT NULL COMMENT 'icon图标地址',
  `way_slogan` varchar(50) DEFAULT NULL COMMENT '推广语',
  `income_type` int(1) DEFAULT '1' COMMENT '收单机构（1.本行2.他行）',
  `way_id` bigint(13) DEFAULT NULL COMMENT '收单通道id',
  `income_num` varchar(50) DEFAULT NULL COMMENT '收单账号',
  `income_line` varchar(50) DEFAULT NULL COMMENT '线下第三方收单，存json数组，如[{"wayId":1,"userName":"莫凡","userNum":"1654553785@qq.com"},{"wayId":2,"userName":"_fjhkasg","userNum":"adlasdsfgsdg"}]',
  `way_contacts` varchar(50) DEFAULT NULL COMMENT '联系人',
  `way_phone` varchar(50) DEFAULT NULL COMMENT '联系方式',
  `way_apk_url` varchar(255) DEFAULT NULL COMMENT '安装apk地址',
  `way_apk_md5` varchar(255) DEFAULT NULL COMMENT 'apk的md5值',
  `way_apk_package` varchar(50) DEFAULT NULL COMMENT 'apk包名',
  `way_apk_size` int(11) DEFAULT NULL COMMENT 'apk文件大小',
  `way_ios_url` varchar(255) DEFAULT NULL COMMENT 'iosSDK地址',
  `way_rate` double(5,2) DEFAULT '0.00' COMMENT '支付费率，单位千分号',
  `way_arrival_type` int(1) DEFAULT '1' COMMENT '到账类型1.T+日期（工作日）2.实时到账3.T+日期',
  `way_arrival_value` int(2) DEFAULT '0' COMMENT '到账时间',
  `way_transition_type` int(1) DEFAULT NULL COMMENT '过渡页类型,1默认模版,2自定义',
  `way_transition_effect` text COMMENT '过渡效果，多个图片地址逗号隔开',
  `way_transition_time` int(2) DEFAULT '1' COMMENT '图片切换的统一间隔时间',
  `way_loding_type` int(1) DEFAULT NULL COMMENT '加载样式1.进度条2.加载图案',
  `progress_groove_color` varchar(10) DEFAULT NULL COMMENT '进度条凹槽色值',
  `progress_color` varchar(10) DEFAULT NULL COMMENT '进度条色值',
  `loading_pic_type` varchar(2) DEFAULT NULL COMMENT '图案加载类型',
  `show_words` varchar(100) DEFAULT NULL COMMENT '显示文字(如:加载中 , 请稍候...)',
  `show_words_color` varchar(10) DEFAULT NULL COMMENT '文字色值',
  `show_words_shadow_color` varchar(10) DEFAULT NULL COMMENT '文字阴影色值',
  `ending_show` int(2) DEFAULT NULL COMMENT '消失动画1.淡出2.从顶部滑动3.从左侧滑动4.从右侧滑动5.从底部滑动6.呈碎片散开',
  `status` int(1) DEFAULT '1' COMMENT '通道状态,1启用,2不启用',
  `is_delete` int(1) DEFAULT '2' COMMENT '是否删除,1是,2否',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='支付集支持的支付通道表';

